INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 1, 1, 40011, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 24001, 0, 2, 125801);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 2, 1, 40011, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 24001, 0, 2, 126001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 3, 1, 40011, 323, "んーと。\nこれ、あげる。\nはい", "プレシア", 24001, 0, 2, 126101);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 4, 2, 40011, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 24001, 0, 2, 125801);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 5, 2, 40011, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 24001, 0, 2, 126001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, 6, 2, 40011, 326, "お兄。\nきてくれて、うれしい", "プレシア", 24001, 0, 2, 126101);
